(1, 14, '2014-05-01 22:00:00', '2014-05-01 22:00:00', '2014-05-01 22:00:00', 'Apertura%20del%20expediente%20de%20Oliver%20Pata, se presenta con sistomas de defensas bajas , se solicitan analiticas para evaluar su estado.\n', 0),
(2, 17, '2014-05-05 22:00:00', '2014-05-05 22:00:00', '2014-05-05 22:00:00', 'Lorem%20ipsum%20dolor%20sit%20amet%2C%20consectetur%20adipiscing%20elit.%20Vestibulum%20quis%20massa%20commodo%2C%20bibendum%20magna%20sit%20amet%2C%20porttitor%20tortor.%20In%20hac%20habitasse%20platea%20dictumst.%20Aliquam%20eros%20lectus%2C%20volutpat%20ac%20massa%20at%2C%20consectetur%20ultrices%20quam.%20Pellentesque%20vel%20neque%20tincidunt%20justo%20gravida%20volutpat.%20Suspendisse%20at%20lectus%20vestibulum%2C%20condimentum%20augue%20a%2C%20lacinia%20odio.%20Maecenas%20at%20pharetra%20ante.%20Pellentesque%20ipsum%20urna%2C%20auctor%20in%20sodales%20eu%2C%20vulputate%20vitae%20nisi.%20Cras%20vel%20ligula%20quam.%20Mauris%20ornare%20pulvinar%20augue%2C%20vitae%20aliquet%20ante%20rutrum%20sed.%20Nam%20id%20placerat%20lectus.%20Vestibulum%20eleifend%20suscipit%20diam%20id%20viverra.%20Integer%20quis%20quam%20tortor.%20Morbi%20in%20lectus%20sollicitudin%2C%20tempor%20diam%20vitae%2C%20sollicitudin%20turpis.%0D%0A%0D%0AEtiam%20scelerisque%20semper%20quam%2C%20et%20ullamcorper%20nibh%20ullamcorper%20id.%20Curabitur%20molestie%2C%20lacus%20ut%20scelerisque%20feugiat%2C%20sem%20enim%20ultricies%20enim%2C%20quis%20consequat%20nunc%20erat%20at%20est.%20Aliquam%20ac%20erat%20sollicitudin%2C%20euismod%20nisl%20sit%20amet%2C%20varius%20quam.%20Donec%20volutpat%20nisl%20id%20magna%20rhoncus%2C%20id%20gravida%20augue%20vehicula.%20Phasellus%20nec%20dui%20purus.%20Sed%20ultricies%20elit%20sit%20amet%20mi%20pulvinar%2C%20ac%20iaculis%20dolor%20lobortis.%20Donec%20quis%20nisi%20risus.%0D%0A%0D%0ANam%20molestie%20quam%20ut%20dui%20auctor%2C%20a%20volutpat%20metus%20ultricies.%20Fusce%20porta%2C%20urna%20ut%20ultricies%20pretium%2C%20neque%20nulla%20malesuada%20neque%2C%20eget%20pulvinar%20nibh%20odio%20eu%20nisi.%20Proin%20condimentum%20a%20nisi%20convallis%20viverra.%20Mauris%20vehicula%20sollicitudin%20velit%2C%20vitae%20placerat%20orci%20cursus%20eget.%20Nunc%20ut%20purus%20lorem.%20Interdum%20et%20malesuada%20fames%20ac%20ante%20ipsum%20primis%20in%20faucibus.%20Sed%20at%20scelerisque%20nunc%2C%20eu%20ultricies%20felis.%20Suspendisse%20dapibus%20erat%20ac%20orci%20cursus%20condimentum.%20Integer%20dapibus%20consequat%20ante.%20Fusce%20vel%20ante%20eget%20ante%20varius%20ultrices%20id%20vitae%20ligula.%20Morbi%20varius%20dolor%20eu%20orci%20bibendum%20ullamcorper.%0D%0A%0D%0ACras%20vitae%20gravida%20dui%2C%20eget%20porttitor%20est.%20Sed%20scelerisque%20fringilla%20odio%2C%20non%20varius%20nibh%20fringilla%20non.%20Integer%20eget%20dictum%20nunc.%20Cum%20sociis%20natoque%20penatibus%20et%20magnis%20dis%20parturient%20montes%2C%20nascetur%20ridiculus%20mus.%20Sed%20diam%20mauris%2C%20adipiscing%20a%20placerat%20at%2C%20laoreet%20ut%20purus.%20Nulla%20sollicitudin%2C%20mauris%20quis%20eleifend%20dictum%2C%20lectus%20dui%20commodo%20mauris%2C%20nec%20mollis%20lectus%20ipsum%20vitae%20tellus.%20Suspendisse%20sit%20amet%20porta%20ante.%20Phasellus%20vehicula%20nibh%20commodo%2C%20sodales%20dui%20ut%2C%20laoreet%20purus.%20Nunc%20aliquam%20imperdiet%20nulla%2C%20ut%20placerat%20odio%20mattis%20viverra.%20Cras%20ante%20neque%2C%20euismod%20vel%20dignissim%20dictum%2C%20mollis%20pellentesque%20ipsum.%20Morbi%20euismod%20felis%20ut%20magna%20ullamcorper%2C%20ut%20pretium%20arcu%20molestie.%20Integer%20at%20nibh%20sed%20tellus%20rutrum%20consectetur%20eget%20cursus%20turpis.', 0),
